package pk02;

public class RelaTest_02 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int num1=5;
		int num2=3;
		
		boolean value=(num1>num2);
		System.out.println(value);
		
		
		System.out.println(num1>=num2);
		System.out.println(num1<=num2);
		System.out.println(num1==num2);
		System.out.println(num1!=num2);

	}

}
